                            </Card>
                        )}
                </Row>
                <Row>
                    {Plans.map(plan =>
                        <Card>
                            <Card.Body>
                                <span>{plan.title}</span>
                                <span>{plan.description}</span>
                            </Card.Body>
                        </Card>
                    )}
                </Row>
                <Row>
                    <Col>
                   <Row>Contatos</Row>
                        <Row>
                            <i>whats</i>
